comment:
커피빈을 신선하지 않은 오래된것을 사용하구요, 신선하지않은 커피맛을 보완하기위해 거의 대부분의 음료가 매우 달아요;
카페로서의 기본인 커피가 좋지 못한점에 대해서는 1점을 주고싶지만 공간자체는 아늑해서 2점을 채택했습니다.
가격이 싼것도 아니고 주변에 다른카페들도 많은데 굳이 돈 더주고 싸구려 커피 먹을바에 다른데 가시는걸 추천.

